export const parameters = {
  backgrounds: {
    default: "dark",
    viewMode: "docs",
    values: [
      {
        name: "dark",
        value: "#000000",
      },
      {
        name: "light",
        value: "#fffff",
      },
    ],
  },
  actions: { argTypesRegex: "^on[A-Z].*" },
  controls: {
    expanded: true,
    matchers: {
      color: /(background|color)$/i,
      date: /Date$/,
    },
  },
};
